import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { AppnavComponent } from '../appnav/appnav.component';



@NgModule({
  declarations: [
    AppnavComponent
  ],
  imports: [
    CommonModule
  ]
})
export class SharedModuleModule { }
